const styles = (theme) => ({
  disabled: {
    color: theme.palette.grey[300],
  },
  enabled: {
    color: theme.palette.success.light,
  },
  toolTip: {
    maxWidth: 'none',
  },
  toolTipTitle: { whiteSpace: 'pre-line' },
});

export default styles;
